will be needed. On the show day, please make our door or security staff aware of your needs and we will assist you in any way we can. At general admission shows we have a designated area for patrons with special needs and one companion. For reserved seated shows, guests with limited mobility should purchase tickets on the floor. Our bathrooms and first floor are all ADA accessible so please make us aware of your needs when purchasing tickets and upon your arrival to the venue", "generalInfo"=>{"generalRule"=>"The following items are prohibited for all shows: weapons, gang colors, alcohol, drugs, lawn chairs, laser pointers, skates, wallet chains, spiked jewelry/belts, banners, backpacks, flyers, beach balls, Frisbees, fireworks, sparklers, outside food or beverages, video equipment. Cameras and audio recording equipment are prohibited at most shows, at the performer's discretion. No smoking or Vaping inside the venue, There is a designated smoking area in the basement downstairs and then to the right, outside. Patrons must be 21 years of age to purchase alcoholic beverages and have proof of age. Anyone buying alcohol must have a “Over 21” wristband which will be given before entry. Camera Policy: Cell phone cameras are permitted. Photography is not permitted at the majority of shows at the Tabernacle, though some bands permit cell phone cameras, provided that they are used without a flash. Photography equipment (with detachable or zoom lenses) is not permitted without an appropriate media or photo pass.", "childRule"=>"Most shows are all ages (but must be 21 to purchase alcohol-patrons will receive wristbands). Please refer to the specific events “Event Details” link for age restrictions."}, "upcomingEvents"=>{"_total"=>37, "ticketmaster"=>37}, "_links"=>{"self"=>{"href"=>"/discovery/v2/venues/KovZpaFEZe?locale=en-us"}}}], "attractions"=>[{"name"=>"Maggie Rogers", "type"=>"attraction", "id"=>"K8vZ9174027", "test"=>false, "url"=>"https://www.ticketmaster.com/maggie-r